// This is a basic React starter code for a fresh project.
import './styles.css';


function Square() {
  return <button className="square">X</button>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Square/>
      </header>
    </div>
  );
}

export default App;
